// Function to display the image based on the selected option
function showImage(option) {
    const imageDisplay = document.getElementById("image-display");
  
    // Object containing image sources and descriptions
    const images = {
      image1: {
        src: "data:image/png;base64,",
        alt: "Beautiful nature with green fields and blue sky",
        description: "AGE WISE IMPACTS"
      },
      image2: {
        src: "data:image/png;base64,",
        alt: "High-tech gadgets and futuristic designs",
        description: "RISE OF PANDEMIC"
      },
      image3: {
        src: "data:image/png;base64,",
        alt: "A beautiful piece of abstract art",
        description: "FORECAST"
      },
      image4: {
        src: "data:image/png;base64,",
        alt: "Outer space with stars and planets",
        description: "NOT EXACTLY BUT AN ASSUMPTION"
      },
      image5: {
        src: "data:image/png;base64,",
        alt: "AGE",
        description: "1 to 19 years: While this age group faced lower severity and mortality rates, they suffered significantly from disruptions to education, social interactions, and mental health due to prolonged school closures and isolation."
        },
        image6: {
            src: "data:image/png;base64,",
            alt: "AGE",
            description: "20 to 40 years: This group experienced high infection rates due to active social and professional lives. Many struggled with economic instability, job losses, and the challenge of balancing remote work with caregiving responsibilities."
            },
            image7: {
                src: "data:image/png;base64,",
                alt: "AGE",
                description: "41 to 60 years: With higher risks of severe illness, this age group faced significant health challenges, especially those with comorbidities like diabetes or hypertension. They also bore the burden of caregiving for both children and elderly family members."
                },
                image8: {
                    src: "data:image/png;base64,",
                    alt: "AGE",
                    description: "61 to 120 years: This group was the most vulnerable, with the highest rates of severe disease and mortality. Prolonged isolation due to the need for strict protective measures led to mental health issues like anxiety and depression among the elderly."
                    },
    };
  
    // Check if the selected option exists in the images object
    if (images[option]) {
      const { src, alt, description } = images[option];
      imageDisplay.innerHTML = `
        <img src="${src}" alt="${alt}">
        <p>${description}</p>
      `;
    } else {
      imageDisplay.innerHTML = `<p>Image not found.</p>`;
    }
  }
  